textOriginal:
*4 bons motivos para petistas inteligentes não votar em Lula:*(Só para quem gosta realmente de Lula)

1. Tem petistas sendo perseguidos por discordarem do ataque à liberdade de expressão. Por isso não vote em Lula, pois com ele no poder isso só tende a piorar;
2. No primeiro turno Lula ficou sem base parlamentar. Se eleito não vai conseguir governar, mas só terá problemas e vexames. Por isso é melhor não votar nele para poupar-lhe de desgastes e vexames;
3. Pela idade e saúde dificilmente  Lula vai conseguir chegar até o fim se for eleito. Havendo  algum impedimento sério ele pode até  ser obrigado a renunciar, dando lugar ao partido do vice. Se for o caso o PT será desapeado do poder, fortalecendo, assim, o Alkmin que voltaria às suas orígens para ressuscitar tucanos. Por isso não vote em Lula para que ele não caia nessa armadilha maldosa do PSDB;
4. No dia 29/10, véspera do segundo turno, Lula completa 77 anos de idade. Em vez de se desgastar com política, para ele seria muito melhor descansar com uma digna aposentadoria e cuidar tranquilamente da sua saúde. Os chefões da esquerda não gostam da Lula. Eles gostam mesmo é de sugar o máximo tudo dele para tirar proveito e vantagem política. Por isso não vote em Lula, pois assim você estará dando a ele um belo presente de aniversário que é curtir a sua velhice em paz e com saúde.

Obs: Conheci Lula no começo da sua carreira e participei de reunião junto dele. Sempre desejo o seu bem e peço a Deus por sua felicidade.
